INSERT INTO `ps_product_lang` VALUES (1,1,2,'Kosiarka 36V o szerokości koszenia 40 cm wyposażona w funkcję Power Assist. Funkcja Power Assist wspiera użytkownika w czasie koszenia na trudnym terenie. Funkcja Easy Edge umożliwia koszenie wzdłuż krawędzi. Jednopunktowa 5-cio pozycyjna możliwość regulacji koszenia w zakresie 20-70 mm. Kosz na trawę o pojemności 45l. W zestawie znajduje się 1x akumulator 5,0Ah i ładowarka.','<p>Marka produktu: RYOBI</p><p>Szerokość (w cm): 43</p><p>Wysokość (w cm): 130</p><p>Głębokość (w cm): 120</p><p>Waga (w kg): 20.5</p>','kosiarka-akumulatorowa-ryobi-max-power-rlm36x41h50pg-36v-40cm','','','','Kosiarka akumulatorowa Ryobi Max Power RLM36X41H50PG 36V 40cm','W magazynie','Ponowne zamówienie dozwolone','',''),(2,1,2,'Kosiarka akumulatorowa Sterwins jest idealnie sprawdzi się na obszarach o powierzchni do 600m². Silnik automatycznie dostosowuje poziom mocy do rodzaju koszonego trawnika. Szerokość cięcia 42 cm oraz opcja „Cutating edge” zapewniają proste cięcie i równo wyznaczają krawędzie. Dzięki centralnej regulacji wysokości koszenia możesz dostosować kosiarkę do swoich potrzeb. Posiada w 6 pozycji koszenia w zakresie od 2,5 do 7,5 cm. Kierownica o regulowanej wysokości „Easy Bag” ułatwia wyjmowanie kosza o pojemności 50 l na trawę. Posiada wskaźnik napełnienia oraz dodatkowy uchwyt ułatwiający opróżnianie kosza. Jego tekstylna część jest wytrzymała i oszczędza miejsce podczas przechowywania. Kosiarka Sterwins jest lekka - waży 13kg i łatwy do przenoszenia dzięki uchwytom na silniku i koszu na trawę. Przechowywanie kosiarki jest zoptymalizowane: można trzymać ją w pionie lub poziomie. Posiada gwarancję na 3 lata. Baterię i ładowarkę należy zakupić osobno. Będziesz potrzebować akumulatora UP40 (40V, 5Ah) i ładowarki 40V.','<p>Marka produktu: STERWINS</p><p>Szerokość (w cm): 47,4</p><p>Wysokość (w cm): 34.5</p><p>Głębokość (w cm): 77.0</p><p>Waga (w kg): 14.000</p>','kosiarka-akumulatorowa-sterwins-solo-40v-42cm','','','','Kosiarka akumulatorowa Sterwins Solo 40V 42cm','W magazynie','Ponowne zamówienie dozwolone','',''),(3,1,2,'Kosiarka akumulatorowa 20V LM2-33P.1 STERWINS przeznaczona do powierzchni do 200 m2. Zaletą urządzenia jest wyprofilowany przód, co zapewnia łatwy dostęp w wąskich przestrzeniach oraz przy przeszkodach. Dodatkowo kosiarka posiada grzebienie boczne, które dokładnie koszą wzdłuż krawędzi chodnika, przy elewacji oraz wszelkiego rodzaju podmurówkach. Rączka posiada regulację wysokości na 2 pozycjach, a naturalna pozycja dłoni na piankowym uchwycie zapewnia optymalny komfort użytkowania. Kosiarkę wyposażono w kosz na trawę o pojemności 30 l z kontrolką napełnienia kosza, która sygnalizuje potrzebę jego opróżnienia. Silnik indukcyjny charakteryzuje się długą żywotnością i zapewnia wydajną pracę kosiarki. Urządzenie zasilane jest akumulatorami LEXMAN (brak w zestawie), które pasują do innych narzędzi z serii STERWINS UP DEXTER, dzięki czemu w razie potrzeby rozbudujesz warsztat o kolejne urządzenia tych marek.','<p>Marka produktu: STERWINS</p><p>Szerokość (w cm): 38.5</p><p>Wysokość (w cm): 33.0</p><p>Głębokość (w cm): 61.5</p><p>Waga (w kg): 9.510</p>','kosiarka-akumulatorowa-sterwins-solo-20v-33cm','','','','Kosiarka akumulatorowa Sterwins Solo 20V 33cm','W magazynie','Ponowne zamówienie dozwolone','',''),(4,1,2,'Akumulatorowa wersja kosiarki STERWINS 360° LM2-36P.1 zapewnia pełną mobilność pracy bez uciążliwych kabli. Urządzenie akumulatorowe posiada wszystkie zalety narzędzia elektrycznego i spalinowego – cicha praca bez zanieczyszczania środowiska oraz bezprzewodowe zasilanie umożliwia swobodne przemieszczanie i koszenie w miejscach bez dostępu do sieci elektrycznej. Kosiarka charakteryzuje się doskonałą zwrotnością, za sprawą skrętnego kółka z przodu oraz dużym tylnym kołom. Rączka posiada regulację wysokości na 3 pozycjach, a naturalna pozycja dłoni na piankowym uchwycie zapewnia optymalny komfort użytkowania. Kosz na trawę o pojemności 35 l z kontrolką napełnienia kosza, która sygnalizuje potrzebę jego opróżnienia. Dostęp do pojemnika jest szybszy, a jego wyjmowanie łatwiejsze, dzięki odpowiedniemu kształtowi kierownicy. Silnik bezszczotkowy charakteryzuje się długą żywotnością i zapewnia wydajną pracę kosiarki. Urządzenie zasilane jest akumulatorem 40V 5 Ah LEXMAN (brak w zestawie), który pasuje do innych narzędzi akumulatorowych STERWINS, dzięki czemu w razie potrzeby możesz dokupić inne narzędzia takie jak pilarka czy kosa.','<p>Marka produktu: STERWINS</p><p>Szerokość (w cm): 41.5</p><p>Wysokość (w cm): 37.0</p><p>Głębokość (w cm): 61.5</p><p>Waga (w kg): 13.000</p>','kosiarka-akumulatorowa-sterwins-solo-40v-36cm','','','','Kosiarka akumulatorowa Sterwins Solo 40V 36cm','W magazynie','Ponowne zamówienie dozwolone','',''),(5,1,2,'','<p>Marka produktu: GARDENX</p><p>Szerokość (w cm): 115</p><p>Wysokość (w cm): 105</p><p>Głębokość (w cm): 43</p><p>Waga (w kg): 18</p>','kosiarka-akumulatorowa-gardenx-sf8a110-w4020y-podkaszarka-nozyce','','','','Kosiarka akumulatorowa Gardenx SF8A110-W4020Y + podkaszarka + nożyce','W magazynie','Ponowne zamówienie dozwolone','',''),(6,1,2,'Zasilana bateryjnie kosiarka LMO 18-33 Battery Set jest gokartem wśród kosiarek. Jej niska masa i wyjątkowa zwrotność ułatwiają bezwysiłkowe koszenie trawników, również tych o bardziej skomplikowanych kształtach. Kosiarka posiada ostry stalowy nóż, który zapewnia schludnie przystrzyżony trawnik bez nierówności i poszarpanych krawędzi. Regulację wysokości koszenia w tym modelu można ustawić w zakresie czterech poziomów w zależności od potrzeb. System koszenia 2 w 1 pozwala na zbieranie pokosu do pojemnika, lub rozprowadzanie go po trawniku jako naturalnego nawozu, w tym celu należy zastosować dołączony klin mulczujący. Dzięki wskaźnikowi napełnienia zawsze wiadomo kiedy należy opróżnić kosz na ściętą trawę. Wygodny uchwyt gąbkowy i zastosowane włączniki po obu stronach rękojeści sprawiają, że obsługa urządzenia jest wyjątkowo łatwa i komfortowa. Uchwyt prowadzący o regulowanej wysokości umożliwia również wybór optymalnej pozycji roboczej dopasowanej do wzrostu użytkownika. Konstrukcja urządzenia jest składana co pozwala oszczędzać miejsce podczas przechowywania. Kosiarka posiada klucz bezpieczeństwa stanowiący dodatkowe zabezpieczenie przed nieumyślnym uruchomieniem, np. przez dzieci. W zestawie z urządzeniem bateria 18V, 5 Ah z szybką ładowarką.','<p>Marka produktu: KARCHER</p><p>Szerokość (w cm): 37,1</p><p>Wysokość (w cm): 99.2</p><p>Głębokość (w cm): 125.1</p><p>Waga (w kg): 13.5</p>','kosiarka-akumulatorowa-karcher-lmo-18-33-battery-set-18v-5ah-33cm','','','','Kosiarka akumulatorowa Kärcher LMO 18-33 Battery Set 18V 5Ah 33cm','W magazynie','Ponowne zamówienie dozwolone','',''),(7,1,2,'Dzięki niskiej wadze i wyjątkowej zwrotności, zasilana bateryjnie kosiarka LMO 18-36 Battery Set pozwala kosić bez wysiłku- nawet na trawnikach o skomplikowanym kształcie. Jej ostry stalowy nóż zapewnia schludnie przystrzyżony trawnik bez nierówności i poszarpanych krawędzi. Dzięki systemowi koszenia 2 w 1 trawa może być zbierana do kosza lub rozprowadzana po trawniku jako naturalny nawóz - w tym celu należy zastosować dołączony klin mulczujący. Wysokość koszenia może być regulowana na czterech poziomach. Urządzenie doskonale radzi sobie z precyzyjnym koszeniem wzdłuż krawędzi, ścian, i ogrodzeń – zapewniają to boczne grzebienie kierujące trawę do obszaru koszenia. Bardzo praktycznym rozwiązaniem jest również zastosowanie wskaźnika napełnienia kosza na trawę, który informuje kiedy należy go opróżnić. Wygodny uchwyt gąbkowy i zastosowane włączniki po obu stronach rękojeści sprawiają, że obsługa urządzenia jest wyjątkowo łatwa i komfortowa. Uchwyt prowadzący o regulowanej wysokości umożliwia również wybór optymalnej pozycji roboczej dopasowanej do wzrostu użytkownika. Konstrukcja urządzenia jest składana co pozwala oszczędzać miejsce podczas przechowywania. Kosiarka posiada klucz bezpieczeństwa stanowiący dodatkowe zabezpieczenie przed nieumyślnym uruchomieniem, np. przez dzieci.W zestawie z urządzeniem bateria 18V, 5 Ah z szybką ładowarką.','<p>Marka produktu: KARCHER</p><p>Szerokość (w cm): 39,8</p><p>Wysokość (w cm): 104.2</p><p>Głębokość (w cm): 130.9</p><p>Waga (w kg): 15.3</p>','kosiarka-akumulatorowa-karcher-lmo-18-36-battery-set-18v-5ah-36cm','','','','Kosiarka akumulatorowa Kärcher LMO 18-36 Battery Set 18V 5Ah 36cm','W magazynie','Ponowne zamówienie dozwolone','',''),(8,1,2,'Kosiarka akumulatorowa Worx WG779E • 2 akumulatory 20 V zapewniają moc 40 V i wydajność silnika elektrycznego. • Funkcja cięcia przy krawędzi, zapewnia dokładnie koszenie krawędzi trawnika, a tym samym oszczędność czasu na przycinanie. • Technologia Intellicut™ zapewnia stałą moc cięcia nawet gęstej trawy. • W pełni składane uchwyty ułatwiają przechowywanie. • Uchwyt transportowy ułatwia przemieszczanie. • Akumulator Powershare jest wymienny z innymi narzędziami WORX 20 V • Idealna do trawników do 280 m2 Podkaszarka akumulatorowa Worx WG157E • Lekka i ergonomiczna konstrukcja • Prosty automatyczny system przesuwny • Wygodna rękojeść z dodatkowym uchwytem ułatwia użytkowanie. • Wydłużona obudowa zapewnia łatwość dotarcia do trudno dostępnych miejsc. • Składana osłona pomaga chronić ozdobne elementy trawnika.','<p>Marka produktu: WORX</p><p>Szerokość (w cm): 48</p><p>Wysokość (w cm): 100</p><p>Głębokość (w cm): 126.7</p><p>Waga (w kg): 13</p>','kosiarka-akumulatorowa-worx-40v-podkaszarka','','','','Kosiarka akumulatorowa Worx 40V + podkaszarka','W magazynie','Ponowne zamówienie dozwolone','',''),(9,1,2,'Bezszczotkowa kosiarka 18 V o szerokości koszenia 37 cm. Kompaktowy kształt ułatwia manewrowanie po ogrodzie. Silnik bezszczotkowy zapewnia szybki i efektywne koszenie. Wytrzymała 6-stopniowa regulacja wysokości koszenia między 25-70 mm. Funkcja EasyEdge™ pozwala kosić tuż przy krawędzi trawnika. Składane uchwyty oraz składany kosz na trawę ułatwiają przechowywanie urządzenia. Kosz na trawę o pojemności 45 litrów.','<p>Marka produktu: RYOBI</p><p>Szerokość (w cm): 40</p><p>Wysokość (w cm): 120</p><p>Głębokość (w cm): 130</p><p>Waga (w kg): 11</p>','kosiarka-akumulatorowa-ryobi-one-ry18lmx37a-0-18v-37cm','','','','Kosiarka akumulatorowa Ryobi One+ RY18LMx37A-0 18V 37cm','W magazynie','Ponowne zamówienie dozwolone','',''),(10,1,2,'Łatwe opróżnianie kosza na trawę. Centralna regulacja wysokości koszenia. Wskaźnik zapełnienia kosza. Koła na łożyskach kulkowych. Główny włącznik zasilania. Wymagane 2 akumulatory po 18 V.','<p>Marka produktu: MAKITA</p><p>Szerokość (w cm): 46,5</p><p>Wysokość (w cm): 107.0</p><p>Głębokość (w cm): 114.5</p><p>Waga (w kg): 13.5</p>','kosiarka-akumulatorowa-makita-solo-dlm382z-2x18v-38cm','','','','Kosiarka akumulatorowa Makita Solo DLM382Z 2x18V 38cm','W magazynie','Ponowne zamówienie dozwolone','',''),(11,1,2,'Kosiarka akumulatorowa do trawy o szerokości koszenia 33 cm. Jednopunktowa, 5-stopniowa regulacja wysokości koszenia od 25 do 65 mm. Funkcja EasyEdge™ dla koszenia przy samej krawędzi. 5-stopniowa regulacja uchwytu dopasuje się do każdego użytkownika. Ergonomiczna rękojeść prowadząca przednia. Możliwość szybkiego składania kosiarki bez użycia narzędzi pozwala na łatwe przechowywanie, które nie wymaga dużo miejsca.','<p>Marka produktu: RYOBI</p><p>Szerokość (w cm): 72</p><p>Wysokość (w cm): 40</p><p>Głębokość (w cm): 40</p><p>Waga (w kg): 8</p>','kosiarka-akumulatorowa-ryobi-olm1833b-18v-33cm','','','','Kosiarka akumulatorowa Ryobi OLM1833B 18V 33cm','W magazynie','Ponowne zamówienie dozwolone','',''),(12,1,2,'Kosiarka elektryczna przeznaczona do pracy na powierzchni do 400 m2 to świetny wybór, jeżeli szukasz optymalnych rozwiązań. Zamontowane kółko, które obraca się o 360°, w połączeniu z większą średnicą tylnych kół - ułatwia prowadzenie kosiarki. Dzięki niemu łatwiej też ominiesz przeszkody. Kosiarka została wyposażona również w uchwyt, który w razie potrzeby pozwoli Ci wygodnie ją przenieść. A udogodnień jest znacznie więcej! Wysokość kierownicy możesz dostosować do swojego wzrostu i podczas pracy wybierać jeden spośród 4 poziomów koszenia. Gdy pojemnik będzie już napełniony, poinformuje Cię o tym kontrolka - to znak że musisz go opróżnić. Kosz wykonany z materiału i plastiku możesz złożyć, co ułatwi przechowywanie. Z kolei wyłącznik termiczny ochroni silnik przed przegrzaniem. Warto też pamiętać, że kosiarka elektryczna jest znacznie bardziej ekologiczna niż ta z silnikiem spalinowym. Kosiarka została objęta 3-letnim okresem gwarancji.','<p>Marka produktu: STERWINS</p><p>Szerokość (w cm): 40</p><p>Wysokość (w cm): 37</p><p>Głębokość (w cm): 72</p><p>Waga (w kg): 11.830</p>','kosiarka-elektryczna-sterwins-360-1400w','','','','Kosiarka elektryczna Sterwins 360 1400W','W magazynie','Ponowne zamówienie dozwolone','',''),(13,1,2,'Kosiarka STERWINS 1200 W sprawdzi się świetnie na powierzchni do 300m2. Została wyposażona w silnik elektryczny, który jest znacznie bardziej ekologiczny niż spalinowy. Model posiada uchwyt, który pozwoli Ci komfortowo ją przenosić, a także w kontrolkę informującą o napełnieniu kosza. Podczas koszenia możesz wybierać jeden z czterech poziomów wysokości, od 2,5 do 7 cm. Dzięki tym funkcjom praca będzie przebiegała sprawnie. Dodatkowo zbiornik został wykonany z plastiku i materiału, dzięki czemu bez problemu go złożysz, co oszczędzi miejsce podczas przechowywania. Jego 30-litrowa pojemność jest optymalna dla rekomendowanej powierzchni koszenia. Kosiarka została objęta gwarancją na 3 lata.','<p>Marka produktu: STERWINS</p><p>Szerokość (w cm): 42</p><p>Wysokość (w cm): 33.0</p><p>Głębokość (w cm): 66.0</p><p>Waga (w kg): 8.131</p>','kosiarka-elektryczna-sterwins-1200w','','','','Kosiarka elektryczna Sterwins 1200W','W magazynie','Ponowne zamówienie dozwolone','',''),(14,1,2,'','<p>Marka produktu: STERWINS</p><p>Szerokość (w cm): 41.5</p><p>Wysokość (w cm): 37</p><p>Głębokość (w cm): 72</p><p>Waga (w kg): 13.500</p>','kosiarka-elektryczna-podkaszarka-sterwins-elm2-36p-3w4z','','','','Kosiarka elekt