 ogrodów. Za pośrednictwem aplikacji GARDENA smart system uzyskujesz wgląd w koszony obszar i dostęp do ogrodu z każdego miejsca na ziemi. Możesz w dowolnym momencie zmieniać ustawienia harmonogramu pracy urządzenia. Funkcja Zarządzania Strefami umożliwia decydowanie o tym, które obszary są koszone i z jaką częstotliwością. Ochrona obszarów pozwala pomijać niektóre obszary, na przykład łąkę kwietną. Aplikacja umożliwia także kontrolę położenia kosiarki w każdej chwili. Jako element GARDENA smart App, LONA Intelligence będzie nieustannie rozwijana tak, by dostarczać naszym klientom coraz ciekawsze i jeszcze bardziej pomocne funkcje w roku 2022 i w kolejnych latach. Ten wydajny pomocnik ogrodnika jest wyjątkowo cichy i może poszczycić się poziomem hałasu najniższym w swojej klasie - zaledwie 57 db(A). Ty i Twoi sąsiedzi możecie dzięki temu wypoczywać w spokoju, podczas gdy on wykonuje ciężką pracę. Zaawansowany technicznie system CorridorCut prowadzi robota koszącego przez wąskie przejazdy i zakręty o szerokości zaledwie 60 centymetrów między przewodami ograniczającymi. CorridorCut wyprowadzi też robota ze ślepych zaułków. Nie musisz już wykonywać pracy ręcznie, Twój robot-ogrodnik poradzi sobie nawet z kłopotliwymi obszarami. Aplikacja GARDENA smart wyposażona jest w asystenta planowania, który pomoże Ci zadbać o ogród. Pracując zgodnie z harmonogramem i opierając się na SensorControl, robot samodzielnie ustala, jak często należy kosić trawę. Ten wydajny pomocnik precyzyjnie dobiera częstotliwość do tempa wzrostu trawy, udając się do pracy tylko wtedy, kiedy jest to potrzebne. Innowacyjna funkcja koszenia punktowego, w trakcie którego robot porusza się ruchem spiralnym, pozwala smart SILENO life na pracę w miejscach trudnodostępnych. Po zakończeniu pracy, smart SILENO life powraca automatycznie do stacji ładującej. Ten wytrzymały robot może pracować o każdej porze roku, niezależnie od pogody i terenu. Robot koszący wyczuwa zmrożone podłoże i wstrzymuje pracę do czasu, gdy temperatura się podniesie. Radzi sobie nawet z pochyłościami o nachyleniu do 35 procent. Ta robotsmart SILENO life wyposażona została w wiele użytecznych funkcji, z którymi można się zapoznać za pośrednictwem aplikacji GARDENA smart. EasyConfig prowadzi użytkownika krok po kroku przez proces instalacji, Auto Schedule sprawia, że smart SILENO life samodzielnie wie, gdzie i jak wykosić trawnik, natomiast SmartHome umożliwia sterowanie robotem smart SILENO life za pomocą głosu, z wirtualną asystentką Alexą. Dodatkowa biblioteka roślin dostarcza ogrodnikom użyteczne informacje na temat świata roślin. Pełnia możliwości inteligentnych maszyn dzięki ofercie GARDENA smart oraz smart SILENO life: inteligentnemu robotowi koszącemu. SILENO.','<p>Marka produktu: GARDENA</p><p>Szerokość (w cm): 39</p><p>Wysokość (w cm): 23</p><p>Głębokość (w cm): 58</p><p>Waga (w kg): 14.5</p>','robot-koszacy-gardena-sileno-19703-72-1250m2-18v-2ah','','','','Robot koszący Gardena Sileno 19703-72 1250m2 18V 2Ah','W magazynie','Ponowne zamówienie dozwolone','',''),(72,1,2,'Wydajny robot koszący do trawników o powierzchni do 1 000 m². Cichy, wszechstronny i inteligentnie zaprojektowany—taki właśnie jest robot koszący GARDENA SILENO life 1000 m². SILENO life, łączący w sobie dużą wydajność i precyzję pracy z wygodą koszenia, znakomicie sprawdzi się w przypadku trawników średniej wielkości. Zaczynamy! Weź swojego smartfona i za pośrednictwem aplikacji GARDENA Bluetooth® wprowadź wielkość trawnika, wybrane dni i preferowane godziny pracy. Aplikacja GARDENA Bluetooth®przeprowadzi Cię w sposób intuicyjny przez całą instalację wstępną. Twój robot koszący sam ułoży program pracy i będzie gotowy, bez dalszego zawracania Ci głowy. Za pośrednictwem technologii Bluetooth® można łatwo i wygodnie sterować SILENO life z odległości do 10 metrów. Kosiarka samodzielnie obliczy optymalny czas koszenia, a aplikacja GARDENA Bluetooth®, wyposażona w asystenta planowania, pomoże Ci odpowiednio zadbać w ogród. Za sprawą wyjątkowo cichego silnika, kosiarkę charakteryzuje najniższy poziom hałasu w tej klasie, zaledwie 57dB(A). Ty i Twoi sąsiedzi możecie w spokoju wypoczywać w ogrodzie, nawet wtedy, kiedy kosiarka pracuje. Zaawansowana funkcja CorridorCut bez trudu przeprowadza kosiarkę przez wąskie przejazdy i miejsca trudno dostępne, o szerokości zaledwie 60 centymetrów. Funkcja ta pozwoli nawet kosiarce wydostać się ze ślepego zaułka. Robot koszący samodzielnie ustala odpowiednią częstotliwość koszenia, korzystając z funkcji SensorControl, która dostosowuje tryb pracy do tempa wzrostu trawy. Twój sprytny mały pomocnik skosi trawę najwydajniej, jak to możliwe. Ten nieustraszony automatyczny pracownik nie zwalnia tempa, niezależnie od pogody czy ukształtowania terenu. SILENO life samodzielnie skosi trawę, nawet podczas deszczu. Inteligentny robot koszący zauważy, jeżeli podłoże będzie zmrożone lub oszronione i zatrzyma program pracy do czasu, gdy temperatura się podniesie. Przewód ograniczający określa, które fragmenty ogrodu mają być koszone przez SILENO life. Z kolei przewód doprowadzający prowadzi kosiarkę niezawodnie i w pełni automatycznie przez tereny pracy. Twoja kosiarka bez problemu pokona wąskie przejścia, a także stoki o nachyleniu do 35 procent. Po wykonaniu pracy, niestrudzony robot-ogrodnik powróci do stacji ładującej na zasłużone doładowanie energią. Maszyna kosi całkowicie samodzielnie, pozostawiając Ci więcej czasu na ulubione zajęcia w ogrodzie. Kosiarkę SILENO life można bez trudu umyć wodą z węża - nic prostszego! Z SILENO life koszenie staje się takie proste. Usiądź i odpręż się, podczas gdy robot koszący wykona całą ciężką pracę za Ciebie. Twój ogród będzie zawsze starannie wypielęgnowany z SILENO life: inteligentnym robotem koszącym. SILENO.','<p>Marka produktu: GARDENA</p><p>Szerokość (w cm): 39.0</p><p>Wysokość (w cm): 23.0</p><p>Głębokość (w cm): 59.0</p><p>Waga (w kg): 13.16</p>','robot-koszacy-gardena-sileno-life-15102-32-1000m2-18v-2ah','','','','Ro